sources.sass\\hero.scss:
@import './variables';

.main_baner,
.app_catalog,
.company,
.new_tools,
.conytibutor,
.response_container {
    width: 90%;
    margin: 0 auto;
    text-align: center;
}

.main_baner {
    width: 100%;
    height: 700px;
    background-image: url("../img/Mask\ Group.png");
    margin-bottom: 200px;

    &_text {
        width: 50%;
        margin-left: 111px;
        padding-top: 178px;

        h1 {
            font-size: 50px;
            font-style: normal;
            font-weight: 500;
            line-height: 140%;
            /* 70px */
        }

        p {
            font-size: 18px;
            font-style: normal;
            font-weight: 400;
            line-height: 30px;
            /* 166.667% */
            // color: $secondary-color;
            margin: 30px 0 60px 0;
        }
    }

    form {
        position: relative;
        width: 515px;

        img {
            position: absolute;
            z-index: 2;
            top: 20px;
            left: 20px;
        }

        input {
            position: relative;
            width: 500px;
            height: 64px;
            border-radius: 15px;
            border: 1.5px solid rgba(255, 255, 255, 0.1);
            background: #283036;
            padding: 20px;
            padding-left: 60px;
            font-size: 14px;
            font-style: normal;
            font-weight: 400;
            line-height: normal;

            &::placeholder {
                font-size: 14px;
                font-style: normal;
                font-weight: 400;
                line-height: normal;
                color: $secondary-color;
            }
        }

        button {
            position: absolute;
            border-radius: 8px;
            background: $accent-color;
            padding: 12px 36px;
            outline: none;
            right: 23px;
            top: 10px;
        }
    }

    .social {
        margin-top: 122px;
        display: flex;
        align-items: center;

        li {
            list-style: none;
            margin-right: 31px;
            cursor: pointer;
        }

        svg {
            fill: $primary-color;

            &:hover {
                fill: $accent-color;
            }
        }
    }
}

.company {
    width: 78%;
    margin-top: 200px;
    border-radius: 25px;
    border: 2px solid rgba(255, 255, 255, 0.05);
    background: rgba(44, 53, 61, 0.20);
    backdrop-filter: blur(25px);
    padding: 55px 63px;
    margin-bottom: 220px;

    // padding-top: 55px;
    p {
        color: $secondary-color;
        margin-bottom: 56px;
        font-size: 24px;
        font-style: normal;
        font-weight: 500;
        line-height: normal;
    }

    .company_icon {
        display: flex;
        align-items: center;
        justify-content: space-between;
    }
}

.new_tools {
    width: 87%;
    display: flex;
    margin-bottom: 100px;

    .text {
        width: 50%;
        text-align: start;
        margin-right: 249px;

        h2 {
            font-size: 48px;
            font-style: normal;
            font-weight: 500;
            line-height: 130%;
            margin-bottom: 30px;
            /* 62.4px */
        }

        p {
            font-size: 18px;
            font-style: normal;
            font-weight: 500;
            line-height: 30px;
            color: $secondary-color;
            margin-bottom: 76px;
        }

        a {
            font-size: 18px;
            font-style: normal;
            font-weight: 500;
            line-height: normal;
            padding: 16px 40px;
            background-color: $accent-color;
            border-radius: 8px;

            &:hover {
                background-color: $accent-color-hovered;
            }
        }
    }

    .tools_cart {
        display: flex;
        flex-wrap: wrap;

        .app_cart {
            width: 265px;
            height: 264px;
            padding: 33px;
            border-radius: 15px;
            margin: 0px 0 50px 0;

            &:nth-child(2) {
                margin-right: 0;
            }

            &:nth-child(4) {
                margin-right: 0;
            }

            &:hover {
                background: rgba(40, 48, 54, 0.6);
                backdrop-filter: blur(25px);
            }

            .head {
                display: flex;
                align-items: flex-start;

                .company_icon {
                    width: 64px;
                    margin-right: 30px;
                }

                ul {
                    text-align: start;

                    .name {
                        font-size: 24px;
                        font-style: normal;
                        font-weight: 500;
                        line-height: normal;
                        margin-bottom: 3px;
                    }

                    .status {
                        font-size: 18px;
                        font-style: normal;
                        font-weight: 400;
                        line-height: normal;
                        color: $accent-color;
                    }
                }
            }

            .cart_desc {
                font-size: 16px;
                font-style: normal;
                font-weight: 400;
                line-height: 30px;
                color: $secondary-color;
                text-align: start;
                margin: 30px 0;
            }

            .control {
                display: flex;
                align-items: center;
                justify-content: space-between;

                .icon {

                    // margin-right: 70px;
                    svg {
                        margin-right: 25px;
                        fill: $secondary-color;
                        cursor: pointer;
                    }
                }

                a {
                    font-size: 16px;
                    font-style: normal;
                    font-weight: 600;
                    line-height: normal;
                    padding: 9px 35px;
                }

                .btn {
                    &:hover {
                        border-radius: 8px;
                        background-color: $accent-color;
                    }
                }
            }
        }
    }
}

.response_container {
    display: flex;
    justify-content: center;
    min-width: 0;
    margin-bottom: 200px;

    .swiper-slide {
        display: flex;
        align-items: center;
        min-width: 0;
        justify-content: center;

        .client_img {
            position: relative;
            margin-bottom: 46px;

            img {
                max-width: 362px;
                max-height: 462px;
            }

            .client_info {
                border-radius: 8px;
                border: 1px solid rgba(255, 255, 255, 0.10);
                background: rgba(40, 48, 54, 0.20);
                backdrop-filter: blur(25px);
                padding: 10px 22px;
                position: absolute;
                bottom: 30px;
                right: 0;
                text-align: start;

                h3 {
                    font-size: 26px;
                    font-style: normal;
                    font-weight: 500;
                    line-height: normal;
                    letter-spacing: 0.39px;
                    margin-bottom: 5px;
                }

                p {
                    font-size: 16px;
                    font-style: normal;
                    font-weight: 400;
                    line-height: normal;
                    color: $secondary-color;
                }
            }
        }

        .response_text {
            width: 393px;

            p {
                font-size: 14px;
                font-style: normal;
                font-weight: 400;
                line-height: 30px;
                /* 214.286% */
                letter-spacing: 0.21px;
            }
        }

        .swiper .swiper-button-next::after,
        .swiper .swiper-button-prev::after {
            color: rgb(243, 249, 249);
            font-size: 12px;
        }
    }

    .swiper-pagination-bullet {
        background: #020202;
        width: 168px;
        height: 8px;
        border-radius: 5px;
    }

    .swiper-pagination-bullet-active {
        background: $accent-color;
        width: 168px;
        min-width: 0;
        height: 8px;
        border-radius: 5px;
    }

    .swiper-button-prev:after,
    .swiper-rtl .swiper-button-next:after {
        color: $accent-color;
        font-size: 38px;
    }

    .swiper-button-next:after,
    .swiper-rtl .swiper-button-prev:after {
        color: $accent-color;
        font-size: 38px;
    }
}

